import styled from "styled-components";

const Searching = () => {
	return (
		<>
			<AllListRes>
				<Input />
			</AllListRes>
		</>
	);
};
export default Searching;

const AllListRes = styled.div`
	text-align: center;
`;

const Input = styled.input.attrs((props) => ({
	type: "text",
}))`
	border: 2px solid palevioletred;
	margin: ${(props) => props.size};
	padding: ${(props) => props.size};
	position: absolute;
	top: 0;
	left: 0;
	width: 100%;
	height: 42.5px;
	line-height: 30px;
	outline: 0;
	border: 0;
	display: none;
	font-size: 1em;
	border-radius: 20px;
	padding: 0 20px;
`;
